//struct emu_env_w32 *emu_env_w32_new(uc_mode mode, uint32_t codeBase, uint32_t stackAddr, uint32_t stackSize)
struct emu_env_w32 *emu_env_w32_new(uc_mode mode)
{
	uc_engine *uc;
	uc_err err;

	struct emu_env_w32 *env = (struct emu_env_w32 *)malloc(sizeof(struct emu_env_w32));
	memset(env,0,sizeof(struct emu_env_w32));
	env->lastApiCalled = strdup("");
	env->lastApiHitCount = -1;
	env->totalApiHits = 0;

	// Initialize emulator in X86-32bit mode
    err = uc_open(UC_ARCH_X86, mode, &uc);
    if (err) {
        printf("Failed on uc_open() with error returned: %u\n", err);
        return 0;
    }

	env->uc = uc;

	//this is ok for now..Unicorn requires full GDT setup to set FS, 
	//we omit it in this sample for simplicity, fs defaults to 0
	if(emu_memory_write_dword(uc,0x30,0x7ffdf000)){ //fs[30] 
		printf("Failed to write peb ptr\n");
        return 0;
	}

	if(emu_memory_write_dword(uc,0x7ffdf00c,0x00251ea0)){ //[+0xC] -> PEB
        printf("Failed to write peb ptr\n");
        return 0;
    } 

	//embed static peb (see scdbg/support/pebBuilder for generator and test suite)
	if (emu_memory_write_block(uc, 0x00251ea0, (void*)peb_data, PEBSIZE )) {
        printf("Failed to write peb data\n");
        return 0;
    } 

	//embed set of MZ headers to represent main process (must exist)
	if (emu_memory_write_block(uc, 0x400000, (void*)process_mz, 0x2c0 )) {
        printf("Failed to write process_mz\n");
        return 0;
    }
	
	if( emu_env_w32_load_dll(env,"kernel32.dll") == -1) printf("Failed to load kernel32.dll\n");
	if( emu_env_w32_load_dll(env,"ntdll.dll") == -1)    printf("Failed to load ntdll.dll\n");
	if( emu_env_w32_load_dll(env,"ws2_32.dll") == -1)   printf("Failed to load ws2_32.dll\n");
	if( emu_env_w32_load_dll(env,"iphlpapi.dll") == -1) printf("Failed to load iphlpapi.dll\n");
	if( emu_env_w32_load_dll(env,"user32.dll") == -1)   printf("Failed to load user32.dll\n");
	if( emu_env_w32_load_dll(env,"shell32.dll") == -1)  printf("Failed to load shell32.dll\n");
	if( emu_env_w32_load_dll(env,"msvcrt.dll") == -1)   printf("Failed to load msvcrt.dll\n");
	if( emu_env_w32_load_dll(env,"urlmon.dll") == -1)   printf("Failed to load urlmon.dll\n");
	if( emu_env_w32_load_dll(env,"wininet.dll") == -1)  printf("Failed to load wininet.dll\n");
	if( emu_env_w32_load_dll(env,"shlwapi.dll") == -1)  printf("Failed to load shlwapi.dll\n");
	if( emu_env_w32_load_dll(env,"advapi32.dll") == -1) printf("Failed to load advapi.dll\n");
	if( emu_env_w32_load_dll(env,"shdocvw.dll") == -1)  printf("Failed to load shdocvw.dll\n");
	if( emu_env_w32_load_dll(env,"psapi.dll") == -1)    printf("Failed to load psapi.dll\n");
	if( emu_env_w32_load_dll(env,"imagehlp.dll") == -1) printf("Failed to load imagehlp.dll\n");
	if( emu_env_w32_load_dll(env,"winhttp.dll") == -1) printf("Failed to load winhttp.dll\n");

	//some shellcode locates GetProcAddress by the following signature we will add it in here in case the k32 
	//we copied in from live memory has different function offsets than the export table were using..
	//.text:GetProcAddress+9 8B 7D 0C                          mov     edi, [ebp+lpProcName]
    //.text:GetProcAddress+C BB FF FF 00 00                    mov     ebx, 0FFFFh
	unsigned char gp[25] = {0x8B, 0xFF, 0x55, 0x8B, 0xEC, 0x51, 0x51, 0x53, 0x57, 0x8B, 0x7D, 0x0C, 0xBB, 0xFF, 0xFF, 0x00, 0x00, 0x3B, 0xFB, 0x0F, 0x86, 0xD1, 0xF2, 0xFF, 0xFF};
	emu_memory_write_block(uc, 0x7c80ada0, gp, 25); 
	
	return env;
}

