int32_t emu_env_w32_load_dll(struct emu_env_w32 *env, char *dllname)
{

	//printf("trying to load dll %s\n", dllname);

	int i;
	uint32_t modsize;

	for ( i=1; known_dlls[i].dllname != NULL; i++ )
	{
		modsize=0;

		if ( _strnicmp(dllname, known_dlls[i].dllname, strlen(known_dlls[i].dllname)) == 0 )
		{
			//printf("loading dll %s\n",dllname);

			struct emu_env_w32_dll *dll = emu_env_w32_dll_new();
	
			/*------ dzzie--------
			int isK32 = _strnicmp(dllname, "kernel32", strlen("kernel32"));
			int isNTDLL = _strnicmp(dllname, "ntdll", strlen("ntdll"));

			if ( isK32 == 0 || isNTDLL == 0 )
			{   
				//this is to support opcode scanners and shellcode which does jmp api+5 hook avoidance..(some without even checking for hook or bp they just do it always...)
				//opcodes from k32 are fairly often used, enough so that we want the offsets to line up exactly 
				 
				HMODULE hMod = 0;
				HRSRC hRes = FindResource(hMod,dllname,"RT_RCDATA");

				if(hRes==NULL){
					printf(">>> Failed to load %s Resource?", dllname);
				}else{
					HGLOBAL hResourceLoaded = LoadResource(hMod, hRes);
					void* lpResLock = LockResource(hResourceLoaded);
				    uint32_t sz = SizeofResource(hMod, hRes);
					if(sz > 0){ //+ 0x1000 is valid for both ntdll and k32 (start of .text section)
						emu_memory_write_block(env->uc, known_dlls[i].baseaddress + 0x1000 , lpResLock, sz); //res file is just the .text opcode section
					}else{ 
						printf(">>> Failed to write %s resource to emu memory?", dllname);
					}
					UnlockResource(lpResLock);
				}
				
			}else{*/
				//at least make sure the expected addr range exists for hook detection codes. added 3.10.11
                //we also must make sure the memory is mapped for unicorn or it will err on access... 1.21.17
				//printf("Loading dummy memory for dll: %s\n", dllname);
				char* tmp = (char*)malloc(known_dlls[i].imagesize);
                if(tmp==0){
                    printf("failed to alloc %x bytes to map in %s\n",known_dlls[i].imagesize, known_dlls[i].dllname);
                }else{
				    memset(tmp,0,known_dlls[i].imagesize);
				    emu_memory_write_block(env->uc, known_dlls[i].baseaddress,  tmp, known_dlls[i].imagesize);
				    free(tmp);
                }
			//}
			//----------------------------

			dll->dllname = strdup(known_dlls[i].dllname);
			dll->version = strdup(known_dlls[i].version);
			dll->baseaddr = known_dlls[i].baseaddress;
			dll->imagesize = known_dlls[i].imagesize;
			int j;
			for ( j=0; known_dlls[i].memory_segments[j].address != 0; j++ )
			{
				/*printf(" 0x%08x %i bytes\n", known_dlls[i].memory_segments[j].address, 
				 	   known_dlls[i].memory_segments[j].segment_size);*/

				emu_memory_write_block(env->uc,
									   known_dlls[i].memory_segments[j].address,
									   (void *)known_dlls[i].memory_segments[j].segment,
									   known_dlls[i].memory_segments[j].segment_size);
			}

			emu_env_w32_dll_exports_copy(dll, known_dlls[i].exports);

			int numdlls=0;
			if ( env->loaded_dlls != NULL )
			{
				while ( env->loaded_dlls[numdlls] != NULL )
					numdlls++;
			}

			env->loaded_dlls = (struct emu_env_w32_dll**)realloc(env->loaded_dlls, sizeof(struct emu_env_w32_dll *) * (numdlls+2));
			env->loaded_dlls[numdlls] = dll;
			env->loaded_dlls[numdlls+1] = NULL;

			return 0;

		}
	}

	return -1;
}

struct emu_env_w32_dll_export *emu_env_w32_eip_check(struct emu_env_w32 *env)
{
	uint32_t eip = emu_cpu_eip_get(env->uc);

	int numdlls=0;
	while ( env->loaded_dlls[numdlls] != NULL )
	{
		/*printf("w32eip_check 0x%08x %s 0x%08x - 0x%08x \n",
			   eip,
			   env->loaded_dlls[numdlls]->dllname,
			   env->loaded_dlls[numdlls]->baseaddr,
			   env->loaded_dlls[numdlls]->baseaddr + env->loaded_dlls[numdlls]->imagesize);*/

		if ( eip > env->loaded_dlls[numdlls]->baseaddr && 
			 eip < env->loaded_dlls[numdlls]->baseaddr + env->loaded_dlls[numdlls]->imagesize )
		{
			//printf("eip %08x is within %s\n",eip, env->loaded_dlls[numdlls]->dllname);
			struct emu_env_w32_dll *dll = env->loaded_dlls[numdlls];

			void* ehi = (*dll->exports_by_fnptr)[eip - dll->baseaddr];
			if ( ehi == NULL )
			{
				//hook detection and cleanup code added 5.15.12 dzzie..sucks but we have to support it :/
				bool ignore = false;
				if((int)HookDetection_callback!=0){
					ehi = (*dll->exports_by_fnptr)[eip - dll->baseaddr-5];
					if ( ehi != NULL ){
						struct emu_env_w32_dll_export *ex = (struct emu_env_w32_dll_export *)ehi;
						if( ex != NULL){
							//if (ex->fnhook != NULL ){ //this check should be disabled the api was found who cares if user hooked it..
								//if the call back handles it (returns 1) then it supports working around
								//hooks in this api, and has cleaned up the stack and we can proceed normally...
								if(HookDetection_callback(ex->fnname) == 1) ignore = true;
                            //}
						}
					}
				}
				if(!ignore){
					printf("unknown call to %08x\n", eip); //this can happen if dll address is not api start (ex: jmp api+5)
					return NULL;
				}
			}

			struct emu_env_w32_dll_export *ex = (struct emu_env_w32_dll_export *)ehi;

			if( ex == NULL){
				return NULL; //this shouldnt happen because the lookup was successful..
			}

			if (ex->fnhook != NULL )
			{
				env->totalApiHits++;
				bool isSpam = strcmp(env->lastApiCalled, ex->fnname) == 0 ? true : false ;
				if(isSpam) env->lastApiHitCount++;
				
				ex->fnhook(env, ex); //transfer execution to the api hook

				if(!isSpam){
					free( env->lastApiCalled );
					env->lastApiCalled = strdup(ex->fnname);
					env->lastApiHitCount = 1;
				}
				 
				return ex;
			}
			else
			{
				//printf("unhooked call to %s\n", ex->fnname);
				return ex;	
			}
		}
		numdlls++;
	}

	return NULL;
}

int32_t emu_env_w32_export_new_hook_ordinal(struct emu_env_w32 *env,
								const char *dllname,
								uint32_t ordinal,
								int32_t	(__stdcall *fnhook)(struct emu_env_w32 *win, struct emu_env_w32_dll_export *ex)
								)
{
	int numdlls=0;
	while ( env->loaded_dlls[numdlls] != NULL )
	{
		struct emu_env_w32_dll* dll = env->loaded_dlls[numdlls];

		if (strncmp(dll->dllname, dllname, strlen(dll->dllname)) == 0)
		{
			void* ehi = (*dll->exports_by_ordinal)[ordinal];

			if (ehi != NULL)
			{
				//printf("hooked %s\n",  exportname);
				struct emu_env_w32_dll_export *ex = (struct emu_env_w32_dll_export *)ehi;
				if(ex != NULL){
					ex->fnhook = fnhook;
				}
				return 0;
			}
			break;
		}
		numdlls++;
	}
 
	printf("hooking ordinal failed for %s.0x%x\n", dllname, ordinal);
 
	return -1;
}


//dzzie this new export allows dll clients to hook api not implemented by libemu
//note that the fnhook prototypes are different user must handle stack and eip on own..
//-----------------------------------------------------------------------
int32_t emu_env_w32_export_new_hook(struct emu_env_w32 *env,
								const char *exportname, 
								int32_t	(__stdcall *fnhook)(struct emu_env_w32 *win, struct emu_env_w32_dll_export *ex),
								void *userdata)
{
	int numdlls=0;
	while ( env->loaded_dlls[numdlls] != NULL )
	{
		if (1)//dllname == NULL || strncasecmp(env->loaded_dlls[numdlls]->dllname, dllname, strlen(env->loaded_dlls[numdlls]->dllname)) == 0)
		{
			void* ehi = (*env->loaded_dlls[numdlls]->exports_by_fnname)[exportname];
			
			if (ehi != NULL)
			{
				//printf("hooked %s\n",  exportname);
				struct emu_env_w32_dll_export *ex = (struct emu_env_w32_dll_export *)ehi;
				if(ex != NULL){
					ex->fnhook = fnhook;
					ex->userdata = userdata;
				}
				return 0;
			}
		}
		numdlls++;
	}
 
	//printf("hooking %s failed\n", exportname);
 
	return -1;
}

